class Solution {
    public int maxOperations(String s) {
        int ans=0;
        int oc=0;
        HashSet<Integer> set=new HashSet<>();
        for(int i=0;i<s.length();i++){
            if(s.charAt(i)=='1'){
                oc++;
            }
            if(s.charAt(i)=='0')
                set.add(oc);
        }
        for(int i:set)
            ans+=i;
        return ans;
    }
}
